import React, { useEffect, useState } from 'react'
import axios from 'axios'
const NewsItem = () => {
    const[data,setData]= useState([]);
  useEffect(()=>{
        const getData = async ()=>{
          const response = await axios.get('https://newsapi.org/v2/top-headlines?country=us&apiKey=a612a032fc214df2962a6fcd6d4fe944')
          setData(response.data.articles);
        }
        getData();
  },[])
  console.log(data);
  return (
    <div className='list'>
        {data.map((val,index)=>{
            return(
                <Home key={index}
                title={val.title}
                description={val.description}
                urlToImage={val.urlToImage} />  
            )
        })}

    </div>
  )
}

export default NewsItem
